INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (1, 4, 1, 1, 1, 2, N'Đồng hồ nam chính hãng LOBINNI L3603-4', 25, 2680000, N'TÍNH NĂNG MOONPHASE: Ô cửa sổ với tính năng Moonphase (xem lịch tuần trăng – lịch âm) trên góc 6h có thể coi là điểm nhấn đắt giá của chiếc đồng hồ này. Mặt trăng tròn cùng các vì sao lấp lánh nổi bật trên nền trời đêm xanh thẳm chính là một thiết kế vô cùng bắt mắt.', N'/image/sp8.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (2, 1, 1, 3, 1, 4, N'Đồng hồ để bàn chính hãng NAMKIN B945-2', 33, 2850000, N'Là sản phẩm của đất nước USA, nơi cội nguồn của nền công nghiệp thế giới nên tất cả các dòng sản phẩm Đồng hồ Teintop đều được trải qua quy trình kiểm định nghiêm ngặt nên chất lượng được đảm bảo tốt nhất. Đồng hồ Teintop chính hãng với chất lượng tốt và giá rẻ khi bước chân vào thị trường Việt Nam đã trở thành một hiện tượng mà rất nhiều người dùng biết đến. Nó đáp ứng được nhu cầu ngon - bổ - rẻ của người dùng tại Việt Nam vì thế Đồng hồ NAMKIN trở thành thương hiệu tầm trung bán chạy nhất tại Việt Nam.', N'/image/sp104.jpg', 1)
