INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (18, 1, 6, 3, 1, 4, N'Đồng hồ để bàn chính hãng PONIGER B1502', 32, 2950000, N'NÉT CỔ ĐIỂN HIẾM CÓ: Đúng như tên gọi “Caballero”, Poniger P7.23-1 sở hữu nét đẹp cổ điển hiếm có, phảng phất phong vị xưa cũ. Chất cổ điển, lịch lãm toát lên từ màu sắc, kiểu dáng cũng như những chi tiết nhấn nhá tinh tế.', N'/image/sp112.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (19, 1, 2, 3, 1, 4, N'Đồng hồ để bàn chính hãng HAZEAL K017', 42, 1350000, N'Kim giây đồng hồ được thiết kế như một cối xay gió đầy tinh xảo đó, ta có thể thấy được sức mạnh, nhiệt huyết luôn cuộn chảy không ngừng nghỉ trong những cỗ máy cơ Caballero. Sức mạnh từ tinh thần chiến đấu quả cảm, hết mình hệt như những hiệp sỹ Tây Ban Nha cổ xưa!', N'/image/sp120.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (20, 1, 1, 3, 1, 4, N'Đồng hồ để bàn chính hãng NAMKIN B1524', 30, 4990000, N'Là sản phẩm của đất nước USA, nơi cội nguồn của nền công nghiệp thế giới nên tất cả các dòng sản phẩm Đồng hồ Teintop đều được trải qua quy trình kiểm định nghiêm ngặt nên chất lượng được đảm bảo tốt nhất. Đồng hồ Teintop chính hãng với chất lượng tốt và giá rẻ khi bước chân vào thị trường Việt Nam đã trở thành một hiện tượng mà rất nhiều người dùng biết đến. Nó đáp ứng được nhu cầu ngon - bổ - rẻ của người dùng tại Việt Nam vì thế Đồng hồ NAMKIN trở thành thương hiệu tầm trung bán chạy nhất tại Việt Nam.', N'/image/sp102.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (21, 2, 1, 3, 1, 5, N'Đồng hồ đôi chính hãng LOBINNI L3003-5', 25, 4900000, N'Lobinni luôn quan niệm chiếc đồng hồ là thứ ghi lại những khoảnh khắc quý giá nhất trong cuộc sống. Để có được những chiếc đồng hồ có chất lượng tốt nhất Lobinni luôn tuyển chọn những người thợ thủ công có tay nghề cao, ít nhất 10 năm kinh nghiệm trong ngành thiết kế và sản xuất đồng hồ.', N'/image/sp100.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (22, 2, 1, 1, 1, 5, N'Đồng hồ đôi chính hãng LOBINNI L3013-1', 28, 5000000, N'Lobinni cam kết chất lượng của sản phẩm luôn là tiêu chí hàng đầu. Mỗi sản phẩm được tạo ra đều xuất phát từ cảm xúc của nghệ nhân sáng tác. Với mỗi chiếc đồng hồ tạo ra chúng đánh dấu khoảng khắc quý giá của của các nghệ nhân và là một phần lịch sử thương hiệu trong chặng đường chinh phục trái tim người yêu đồng hồ.', N'/image/sp84.jpg', 1)
