INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (101, 4, 3, 1, 1, 3, N'Đồng hồ nam chính hãng Teintop T7016-10', 46, 1250000, N'BỘ MÁY ĐA DẠNG: Từ những cỗ máy QUARTZ chính xác đến từng giây đếm nhịp tới những cỗ máy CƠ ráp máy Miyota Nhật Bản bền bỉ. Điều đặc biệt, trong tầm giá trên 1 TRIỆU, bạn sẽ khó tìm được một cỗ máy đẳng cấp và chất lượng như TeinTop.', N'/image/sp20.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (102, 4, 3, 1, 1, 3, N'Đồng hồ nam chính hãng Teintop T7016-10', 50, 1550000, N'BỘ MÁY ĐA DẠNG: Từ những cỗ máy QUARTZ chính xác đến từng giây đếm nhịp tới những cỗ máy CƠ ráp máy Miyota Nhật Bản bền bỉ. Điều đặc biệt, trong tầm giá trên 1 TRIỆU, bạn sẽ khó tìm được một cỗ máy đẳng cấp và chất lượng như TeinTop', N'/image/sp19.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (103, 4, 1, 2, 1, 2, N'Đồng hồ nam chính hãng LOBINNI L1810-1', 38, 5350000, N'ĐỘ CHÍNH XÁC CAO - HOẠT ĐỘNG ỔN ĐỊNH - BỀN BỈ, HIỆN ĐẠI, sở hữu 21 chân kính bảo vệ khớp nối, tần số 21.600 giúp đồng hồ vận hành bền bỉ, mượt mà', N'/image/sp7.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (104, 4, 1, 1, 1, 1, N'Đồng hồ nam chính hãng LOBINNI L9010-3', 36, 5280000, N'Vàng hồng 18K: Là vàng nguyên khối, phủ trọn gần như là toàn bộ mặt số đồng hồ LOBINNI L9010. Trong khi đó, sự sang trọng lại được kết hợp với nền tảng Skeleton độc đáo, giúp các quý ông chìm đắm ở cả mặt trước lẫn mặt sau thiết kế.', N'/image/sp6.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (105, 4, 1, 1, 1, 1, N'Đồng hồ nam chính hãng LOBINNI L18016-1', 52, 4850000, N'VẺ ĐẸP CỔ ĐIỂN: Kiểu số cọc nổi xen lẫn số học trò và vân Guilloche'' đã tạo nên sức hút mạnh mẽ cho Lobinni. Nét đẹp mang phong cách cổ điển nhưng rất hợp với phong thái của các quý ông thời đại.', N'/image/sp5.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (106, 4, 1, 1, 1, 8, N'Đồng hồ nam chính hãng LOBINNI L16050-2', 50, 4800000, N'Lobinni luôn quan niệm chiếc đồng hồ là thứ ghi lại những khoảnh khắc quý giá nhất trong cuộc sống. Để có được những chiếc đồng hồ có chất lượng tốt nhất Lobinni luôn tuyển chọn những người thợ thủ công có tay nghề cao, ít nhất 10 năm kinh nghiệm trong ngành thiết kế và sản xuất đồng hồ.', N'/image/sp4.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (107, 4, 1, 2, 1, 8, N'Đồng hồ nam chính hãng LOBINNI L9010-1', 42, 5280000, N'Tuyệt tác đồng hồ LOBINNI L9010 phô diễn những đường nét nghệ thuật đã giúp khơi gợi nên hình ảnh của một quý ông phong trần, lịch lãm. Dưới lớp kính Sapphire cao cấp, toàn bộ tinh hoa, giá trị của đồng hồ Thụy Sỹ toát ra mạnh mẽ.', N'/image/sp3.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (108, 4, 1, 1, 1, 8, N'Đồng hồ nam chính hãng LOBINNI L12032-1', 35, 4550000, N'Lobinni cam kết chất lượng của sản phẩm luôn là tiêu chí hàng đầu. Mỗi sản phẩm được tạo ra đều xuất phát từ cảm xúc của nghệ nhân sáng tác. Với mỗi chiếc đồng hồ tạo ra chúng đánh dấu khoảng khắc quý giá của của các nghệ nhân và là một phần lịch sử thương hiệu trong chặng đường chinh phục trái tim người yêu đồng hồ.', N'/image/sp2.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (109, 4, 1, 2, 1, 7, N'Đồng hồ nam chính hãng LOBINNI L17511-1', 30, 5480000, N'ĐƠN GIẢN nhưng TINH TẾ: Thiết kế 3 kim 1 lịch cùng cọc số thanh mảnh nổi hẳn giữa màu mặt xanh thẳm cho thấy sự chỉn chu, sắc sảo trong từng đường nét. SẮC VÀNG HỒNG VƯƠNG GIẢ: Sự uy quyền, sang trọng được tạo nên bởi sắc vàng kim rực rỡ nhờ công nghệ mạ PVD tiên tiến nhất hiện nay.', N'/image/sp1.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (110, 4, 1, 1, 1, 2, N'Đồng hồ nam chính hãng LOBINNI L5018-1', 28, 5530000, N'Thiết kế 3 kim được vót nhọn thanh mảnh vô cùng đơn giản, toàn bộ phần kim và phần số được mạ vàng nổi bật trên nền đen cổ điển huyền bí. Bộ máy bền bỉ in-house chính hãng Lobinni sản xuất – một trong những cỗ máy được đánh giá bền bỉ và chính xác bậc nhất.', N'/image/sp9.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (111, 4, 1, 1, 1, 2, N'Đồng hồ nam chính hãng LOBINNI L18012-2', 25, 5880000, N'Là một trong hai màu sắc cơ bản đầy ấn tượng, màu đen đem đến một sự lôi cuốn đặc biệt đến từ phái mạnh. Nó làm tăng lên sự lịch lãm đầy sang trọng và sự bí ẩn cho các quý ông. Vừa là sự lựa chọn an toàn, vừa chuẩn mực đàn ông, những phụ kiện màu đen luôn là sự lựa chọn số một của mọi quý ông.', N'/image/sp10.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (112, 4, 1, 2, 1, 2, N'Đồng hồ nam chính hãng LOBINNI Ref.1023-7 (Phiên bản đặc biệt Limited)', 18, 4450000, N'Tính năng SUN & MOON độc lạ với biểu tượng Nhật - Nguyệt tương phùng như ôm trọn cả vòng tuần hoàn ngày đêm trên cổ tay. Tính năng SUN & MOON độc lạ với biểu tượng Nhật - Nguyệt tương phùng như ôm trọn cả vòng tuần hoàn ngày đêm trên cổ tay. Trên nền mặt trắng với viền xung quanh vàng hồng sang trọng nổi bật, tinh xảo, đậm chất nghệ thuật tựa như những tia sáng mặt trời tỏa rạng, đẹp mê hồn.', N'/image/sp11.jpg', 1)
