INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (115, 4, 1, 2, 1, 2, N'Đồng hồ nam chính hãng LOBINNI L9010-6', 23, 5380000, N'Máy Miyota 8215: Cỗ máy Miyota hoạt động vô cùng mạnh mẽ. Citizen nhà sản xuất bộ máy Miyota luôn mang đến cho đồng hồ LOBINNI máy cơ nói riêng, đồng hồ cơ trên toàn thế giới nói chung những giá trị tuyệt diệu về độ bền, độ chính xác, chức năng cũng như giá cả! Đáp ứng mọi tiêu chuẩn khắt khe của người dùng.', N'/image/sp14.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (116, 4, 1, 1, 1, 3, N'Đồng hồ nam chính hãng LOBINNI L12030-1', 33, 4650000, N'Lobinni luôn quan niệm chiếc đồng hồ là thứ ghi lại những khoảnh khắc quý giá nhất trong cuộc sống. Để có được những chiếc đồng hồ có chất lượng tốt nhất Lobinni luôn tuyển chọn những người thợ thủ công có tay nghề cao, ít nhất 10 năm kinh nghiệm trong ngành thiết kế và sản xuất đồng hồ.', N'/image/sp15.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (117, 4, 3, 1, 1, 3, N'Đồng hồ nam chính hãng Teintop T7015-1', 48, 1250000, N'KÍNH SAPPHIRE với độ chống xước hoàn hảo, độ cứng chỉ xếp sau kim cương. Đặc biệt, một số dòng sản phẩm sử dụng loại kính Sapphire cong cớn tạo chiều sâu cho mặt số. Với một mức giá tầm trung, đây có thể xem là ĐIỂM SÁNG đáng ghi nhận của cỗ máy thời gian này!', N'/image/sp16.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (118, 4, 3, 1, 1, 3, N'Đồng hồ nam chính hãng Teintop T7015-2', 50, 1250000, N'BỘ MÁY ĐA DẠNG: Từ những cỗ máy QUARTZ chính xác đến từng giây đếm nhịp tới những cỗ máy CƠ ráp máy Miyota Nhật Bản bền bỉ. Điều đặc biệt, trong tầm giá trên 1 TRIỆU, bạn sẽ khó tìm được một cỗ máy đẳng cấp và chất lượng như TeinTop T7015-4.', N'/image/sp17.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (119, 4, 3, 1, 1, 3, N'Đồng hồ nam chính hãng Teintop T7015-3', 50, 1250000, N'KÍNH SAPPHIRE với độ chống xước hoàn hảo, độ cứng chỉ xếp sau kim cương. Đặc biệt, một số dòng sản phẩm sử dụng loại kính Sapphire cong cớn tạo chiều sâu cho mặt số. Với một mức giá tầm trung, đây có thể xem là ĐIỂM SÁNG đáng ghi nhận của cỗ máy thời gian này!', N'/image/sp18.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (120, 3, 3, 2, 1, 7, N'Đồng hồ nữ chính hãng Teintop T8685-2', 31, 2750000, N'Nhiệm vụ của Teintop không chỉ giới hạn trong việc quan tâm đến thế giới đồng hồ dành cho những người sành sỏi đồng hồ chất lượng và nổi bật mà còn là để giúp cho những người có đam mê với đồng hồ lựa chọn và đánh giá những sản phẩm chất lượng cao, những người mong muốn sở hữu những mẫu đồng hồ cổ điển sang trọng với giá cả hợp lý.', N'/image/sp39.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (121, 5, 5, 3, 1, 2, N'Đồng hồ trang trí nghệ thuật họa tiết Lá DH26', 26, 1250000, N'TỔNG THỂ HÀI HÒA: Sự kết hợp tinh tế giữa xanh và trắng, kết hợp vòng benzen đính đá tinh tinh xảo. Viền trắng thép 316L tạo nên mặt đồng hồ đẹp như tạc. THIẾT KẾ KINH ĐIỂN: Đặc biệt bức tranh dãy núi Alpes hùng vĩ, cùng bầu trời cao vút. Tạo nên sức mạnh hùng vĩ từ trời Âu.', N'/image/sp161.jpg', 1)
