INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (140, 2, 3, 1, 1, 6, N'Đồng hồ đôi chính hãng Teintop T7004-14', 35, 2990000, N'Là sản phẩm của đất nước USA, nơi cội nguồn của nền công nghiệp thế giới nên tất cả các dòng sản phẩm Đồng hồ Teintop đều được trải qua quy trình kiểm định nghiêm ngặt nên chất lượng được đảm bảo tốt nhất. Đồng hồ Teintop chính hãng với chất lượng tốt và giá rẻ khi bước chân vào thị trường Việt Nam đã trở thành một hiện tượng mà rất nhiều người dùng biết đến. Nó đáp ứng được nhu cầu ngon - bổ - rẻ của người dùng tại Việt Nam vì thế Đồng hồ Teintop trở thành thương hiệu tầm trung bán chạy nhất tại Việt Nam.', N'/image/sp72.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (141, 3, 1, 2, 1, 6, N'Đồng hồ nữ chính hãng LOBINNI L2010-1', 32, 4250000, N'Trải qua nhiều thập kỷ, Lobinni đã không ngừng phát triển và đã có những bước tiến vô cùng vuợt bậc. Trong đó có việc chế tạo thành công những chiếc đồng hồ Tourbillon đẳng cấp và sang trọng. Không ngừng học hỏi và ứng dụng nhiều công nghệ mới vào việc chế tác đồng hồ, do đó Đồng hồ Lobinni luôn được đánh giá cao và được nhiều người tiêu dùng ưa thích, lựa chọn.', N'/image/sp62.jpg', 1)
