INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (160, 3, 1, 2, 1, 6, N'Đồng hồ nữ chính hãng LOBINNI L2006-1', 57, 3950000, N'Lobinni cam kết chất lượng của sản phẩm luôn là tiêu chí hàng đầu. Mỗi sản phẩm được tạo ra đều xuất phát từ cảm xúc của nghệ nhân sáng tác. Với mỗi chiếc đồng hồ tạo ra chúng đánh dấu khoảng khắc quý giá của của các nghệ nhân và là một phần lịch sử thương hiệu trong chặng đường chinh phục trái tim người yêu đồng hồ.', N'/image/sp59.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (161, 3, 3, 2, 1, 7, N'Đồng hồ nữ chính hãng Teintop T8629-7', 22, 2600000, N'Nhiệm vụ của Teintop không chỉ giới hạn trong việc quan tâm đến thế giới đồng hồ dành cho những người sành sỏi đồng hồ chất lượng và nổi bật mà còn là để giúp cho những người có đam mê với đồng hồ lựa chọn và đánh giá những sản phẩm chất lượng cao, những người mong muốn sở hữu những mẫu đồng hồ cổ điển sang trọng với giá cả hợp lý.', N'/image/sp41.jpg', 1)
INSERT [dbo].[SanPhams] ([Id], [LSPId], [brandId], [wireId], [machineId], [nccId], [name], [amount], [price], [description], [img], [status]) VALUES (162, 5, 5, 3, 1, 2, N'Đồng hồ trang trí bản đồ thế giới DH71', 34, 1750000, N'TỔNG THỂ HÀI HÒA: Sự kết hợp tinh tế giữa xanh và trắng, kết hợp vòng benzen đính đá tinh tinh xảo. Viền trắng thép 316L tạo nên mặt đồng hồ đẹp như tạc. THIẾT KẾ KINH ĐIỂN: Đặc biệt bức tranh dãy núi Alpes hùng vĩ, cùng bầu trời cao vút. Tạo nên sức mạnh hùng vĩ từ trời Âu.', N'/image/sp162.jpg', 1)
